    return (
      <div>
        <center>
         <h2 className="r7"> Rwenzori  Airlines Membership Log In Page</h2><br />
         <img src="https://cdn.thinglink.me/api/image/792008968430944257/1024/10/scaletowidth" className="r15" alt=""/>
         <br />
         <label>UserName/Email:</label><br />
         <input type="text" name="Email"/><br />
         <label>Password:</label><br />
         <input type="password" name="password"/><br /><br />
         <input class="btn btn-primary" type="submit" value="Login"></input><br />
              
        </center><br /><br /><br />
        <div className="footer">
    <p>@copyright@2016 Rwenzori Airline.All right reserve</p>
  </div>
      </div>
    )
  }
}
